description:
Alexis Ford left something back at her friend's house. Her friend is out, but her friend's husband, Erik, is around. Alexis finds what she was looking for....her pink pair of panties. Erik is perplexed as to why Alexis would leave her panties at his house. Apparently, Alexis and Erik's wife had a bit too much to drink the other night and started experimenting with each other. Erik's jealous, of course, because he didn't get in on the action, but Alexis is more than willing to make it up to him by showing him some of the many things he did with his wife.


